--local mapName = MapConfiguration.GetValue("MapName")
print("Loading Largest Earth (Customizable) script")

local g_iW = 230
local g_iH = 116
local g_iFlags = {}
local g_continentsFrac = nil

local g_StartX	= MapConfiguration.GetValue("StartX") or 0
local g_StartY	= MapConfiguration.GetValue("StartY") or 0
local g_EndX	= MapConfiguration.GetValue("EndX") or 229
local g_EndY	= MapConfiguration.GetValue("EndY") or 115

if g_StartX < g_EndX then g_iW = g_EndX - g_StartX + 1 end
if g_StartX > g_EndX then g_iW = g_iW - (g_StartX - g_EndX) + 1 end

if g_StartY < g_EndY then g_iH = g_EndY - g_StartY + 1 end
if g_StartY > g_EndY then g_iH = g_iH - (g_StartY - g_EndY) + 1 end

------------------------------------------------------------------------------
-- The application side will call GetMapScriptInfo directly to request
-- information about the map script.
-------------------------------------------------------------------------------
function GetMapInitData(worldSize)
	return {
		Width = g_iW,
		Height = g_iH,
		WrapX 	= (g_iW == 230),
		WrapY 	= false,
	};      
end

function GetIndexFromXY(iY, iX)
	return (iY * g_iW) + iX;
end

-------------------------------------------------------------------------------
function GenerateMap()
	print("Calling Map Generator");
	-- Everything has been moved to the modded AssignStartingPlots in the "override" folder, search for "YnAMP" string in that file
	GenerateImportedMap(GetMap(), GetCiv6DataToConvert(), GetNaturalWonders(), g_iW, g_iH)
	
	local bOnlyOffset = true -- no need to use relative placement for the code below
	
	-- Handle Nile delta flow direction (North)
	for x = 36, 41 do
		for y = 58, 64 do
			local plot = GetPlotFromRefMap(x,y, bOnlyOffset)
			if plot then
				MakeRiverFlowToNorth(plot)			
			end
		end
	end
	
	-- Handle source of the Nile flow direction	
	for x = 40, 41 do
		for y = 36, 38 do
			local plot = GetPlotFromRefMap(x,y, bOnlyOffset)
			if plot then
				MakeRiverFlowToNorth(plot)			
			end
		end
	end
	
	-- Volga direction
	local plot = GetPlotFromRefMap(47,96, bOnlyOffset)
	if plot then
		MakeRiverFlowToSouthOrEast(plot)
	end
	-- Svir direction
	local plot = GetPlotFromRefMap(39,97, bOnlyOffset)
	if plot then
		MakeRiverFlowToSouthOrWest(plot)
	end

end

